import React from 'react';
import HomeRoundedIcon from '@material-ui/icons';
import ClassRoundedIcon from '@material-ui/icons';
import CalendarTodayRoundedIcon from '@material-ui/icons';
import ListRoundedIcon from '@material-ui/icons';
import TimerRoundedIcon from '@material-ui/icons';

export const NavBarItems =[
    {
        title: "Home",
        icon: <HomeRoundedIcon color="gray" />
    },

    {
        title: "Units",
        icon: <ClassRoundedIcon color="gray" />
    },

    {
        title: "Calendar",
        icon: <CalendarTodayRoundedIcon color="gray" />
    },

    {
        title: "Reminder",
        icon: <ListRoundedIcon color="gray"/>
    },

    {
        title: "Study Timer",
        icon: <TimerRoundedIcon color="gray" />
    },

];
